function PixelEscape:generateTunnel()
    local j = 1
    for i = self.tunnelOffset + 1, self.tunnelSize do
        self.tunnel[j] = self.tunnel[i]
        j = j + 1
    end
    self.tunnelOffset = 0
    local random = math.random
    for i = self.visibility + 1, self.tunnelSize do
        local newValue = (i == 1
                      and self.tunnel[self.visibility]
                       or self.tunnel[i - 1])
                       + (random(-1, 1) * self.stepSize)
        if newValue < 0 then
            newValue = 0
        elseif newValue + self.gapSize >= 212 then
            newValue = newValue - self.stepSize
        end
        self.tunnel[i] = newValue
    end
end

function PixelEscape:updatePosition(player, up)
    if self.player[player].freezePlayer then
        return
    end
    self.player[player].velocity = self.player[player].velocity + (up and -self.player[player].upVelocity or self.player[player].downVelocity)
    self.player[player].position = self.player[player].position + self.player[player].velocity
end

function PixelEscape:checkCollision(player)
    self.player[player].collision = self.player[player].position < self.tunnel[self.tunnelOffset + 3]
end

function PixelEscape:takeSnapshot(player)
    for i = 1, self.visibility do
        local tunnelIndex = self.tunnelOffset + i
        // stub
    end
end

function PixelEscape:drawTunnel()
    if self.players == 1 and not self.player[1].freezeTunnel then
        for i = 1, self.visibility do
            local tunnelIndex = self.tunnelOffset + i
            local blockPosition = (i - 1) * self.blockWidth
            self.gc:fillRect(blockPosition, 0,
                             self.blockWidth, self.tunnel[tunnelIndex])
            self.gc:fillRect(blockPosition, self.tunnel[tunnelIndex] + self.gapSize,
                             self.blockWidth, 213 - (self.tunnel[tunnelIndex] + self.gapSize))
        end
    elseif self.players == 2 then
        for i = 1, self.visibility do
            local tunnelIndex = self.tunnelOffset + i
            local blockPosition = (i - 1) * self.blockWidth
            local blockBottomHeight = 213 - (self.tunnel[tunnelIndex] + self.gapSize)
            if not self.player[1].freezeTunnel then
                local blockWidthFixed = i == length
                                        and self.blockWidth - 1
                                        or self.blockWidth
                self.gc:fillRect(blockPosition, 0,
                                 blockWidthFixed, self.tunnel[tunnelIndex])
                self.gc:fillRect(blockPosition, self.tunnel[tunnelIndex] + self.gapSize,
                                 blockWidthFixed, blockBottomHeight)
            end
            if not self.player[2].freezeTunnel then
                self.gc:fillRect(blockPosition + 159, 0,
                                 self.blockWidth, self.tunnel[tunnelIndex])
                self.gc:fillRect(blockPosition + 159, self.tunnel[tunnelIndex] + self.gapSize,
                                 self.blockWidth, blockBottomHeight)
            end
            self.gc:fillRect(159, 0, 1, 318)
        end
    end
    if self.tunnelOffset + self.visibility == self.tunnelSize then
        self:generateTunnel()
    elseif timer.getMilliSecCounter() - self.timer.tunnelUpdate >= self.tunnelSpeed then
        self.tunnelOffset = self.tunnelOffset + 1
        self.timer.tunnelUpdate = timer.getMilliSecCounter()
    end
end

function PixelEscape:drawMenu()
    if self.status.onMenu then
        self.gc:drawImage(self.images.menuBackground, 0, 0)
        self.gc:drawImage(self.images.menuText, 122, 90)
    end
end

function PixelEscape:drawNumber(number, x, y)
    local length = tostring(number):len()
    for i = 1, length do
        self.gc:drawImage(self.images["digit" .. s:sub(i, i)],
                          x + ((i - 1) * 10), y)
    end
end

function PixelEscape:drawPlayer(player)
    self.gc:fillRect(player == 1 and 10 or 170, self.player[player].position, 10, 10)
end

function PixelEscape:charIn(c)
    if self.status.onMenu then
        if c == "1" then
            self.status.onMenu = false
            self.status.inGame = true
            self:generateTunnel()
        elseif c == "2" then
            self.players = 2
            self.visibility = 32
            self.status.onMenu = false
            self.status.inGame = true
            self:generateTunnel()
        end
    elseif self.status.inGame then
        if c == "1" then
            self:updatePosition(1, true)
        elseif c == "3" then
            self:updatePosition(2, true)
        end
    end
end

function PixelEscape:draw()
    if self.status.onMenu then
        self:drawMenu()
    elseif self.status.inGame then
        self:updatePosition(1)
        self:checkCollision(1)
        if self.player[1].collision then
            self.player[1].freezeTunnel = true
            self.player[1].freezePlayer = true
        end
        self:drawTunnel()
        self:drawPlayer(1)
        if self.players == 2 then
            self:updatePosition(2)
            self:checkCollision(2)
            if self.player[2].collision then
                self.player[2].freezeTunnel = true
                self.player[2].freezePlayer = true
            end
            self:drawPlayer(2)
        end
    end
end

function on.charIn(c)
    pixelEscape:charIn(c)
end

function on.create()
    timer.start(0.01)
end

function on.timer()
    platform.window:invalidate()
end

local initialized = false
function on.paint(gc)
    if not initialized then
        pixelEscape = PixelEscape()
        initialized = true
    end
    pixelEscape:draw()
end